script: |
  super -f text -I q7944.spq | sort > q7944.out

inputs:
  - name: q7944.spq
    data: |
      SELECT col1 FROM tab1 (FORMAT parquet) WHERE ( NOT ( NOT - - col1 NOT BETWEEN + 69 + - - 56 - + col0 AND + + col0 * - + col1 * + 12 + col0 ) );
  - name: tab1

outputs:
  - name: q7944.out
    data: |
      14
      47
      5
